//render page for MenuPage, decoupled from index.jsx in MenuPage
import React from "react";

export function MenuComponent({ guilds }) {
  return (
    //dynamic rendering/iterate through guilds array
    <div>
      <h1>Hello</h1>
      {guilds.map((guild) => (
        <li>{guild.name}</li>
      ))}
    </div>
  );
}
